import React, { Suspense, useMemo, useState } from "react";
import { Canvas } from "react-three-fiber";
import { GLTFLoader } from "three/addons/loaders/GLTFLoader";
import RubiksCubeModel from "./RubiksCubeModel";
import "./App.css";
import { useLoader } from "react-three-fiber";
const RubiksCube = () => {
  const { scene } = useLoader(GLTFLoader, "/rubikcube.gltf");
  const [drag, setDrag] = useState(true);

  const nodesSubset0 = useMemo(() => scene.children.slice(0, 1), [scene]);
  const nodesSubset1 = useMemo(() => scene.children.slice(1, 2), [scene]);
  const nodesSubset2 = useMemo(() => scene.children.slice(2, 3), [scene]);
  const nodesSubset3 = useMemo(() => scene.children.slice(3, 4), [scene]);
  const nodesSubset4 = useMemo(() => scene.children.slice(4, 5), [scene]);
  const nodesSubset5 = useMemo(() => scene.children.slice(5, 6), [scene]);
  const nodesSubset6 = useMemo(() => scene.children.slice(6, 7), [scene]);
  const nodesSubset7 = useMemo(() => scene.children.slice(7, 8), [scene]);
  const nodesSubset8 = useMemo(() => scene.children.slice(8, 9), [scene]);
  const nodesSubset9 = useMemo(() => scene.children.slice(9, 10), [scene]);
  const nodesSubset10 = useMemo(() => scene.children.slice(10, 11), [scene]);
  const nodesSubset11 = useMemo(() => scene.children.slice(11, 12), [scene]);
  const nodesSubset12 = useMemo(() => scene.children.slice(12, 13), [scene]);
  const nodesSubset13 = useMemo(() => scene.children.slice(13, 14), [scene]);
  const nodesSubset14 = useMemo(() => scene.children.slice(14, 15), [scene]);
  const nodesSubset15 = useMemo(() => scene.children.slice(15, 16), [scene]);
  const nodesSubset16 = useMemo(() => scene.children.slice(16, 17), [scene]);
  const nodesSubset17 = useMemo(() => scene.children.slice(17, 18), [scene]);
  const nodesSubset18 = useMemo(() => scene.children.slice(18, 19), [scene]);
  const nodesSubset19 = useMemo(() => scene.children.slice(19, 20), [scene]);
  const nodesSubset20 = useMemo(() => scene.children.slice(20, 21), [scene]);
  const nodesSubset21 = useMemo(() => scene.children.slice(21, 22), [scene]);
  const nodesSubset22 = useMemo(() => scene.children.slice(22, 23), [scene]);
  const nodesSubset23 = useMemo(() => scene.children.slice(23, 24), [scene]);
  const nodesSubset24 = useMemo(() => scene.children.slice(24, 25), [scene]);
  const nodesSubset25 = useMemo(() => scene.children.slice(25, 26), [scene]);
  const nodesSubset26 = useMemo(() => scene.children.slice(26,27), [scene]);



  const handleDragChange = (newDrag) => {
    setDrag(newDrag);
  };


  return (
    <Canvas>
      <ambientLight />
      <Suspense fallback={null}>
        <RubiksCubeModel nodesSubset={nodesSubset0} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset1} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset2} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset3} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset4} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset5} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset6} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset7} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset8} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset9} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset10} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset11} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset12} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset13} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset14} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset15} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset16} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset17} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset18} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset19} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset20} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset21} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset22} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset23} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset24} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset25} drag={drag} onDragChange={handleDragChange} />
        <RubiksCubeModel nodesSubset={nodesSubset26} drag={drag} onDragChange={handleDragChange} />
      </Suspense>
      <pointLight position={[10, 10, 10]} />
    </Canvas>
  );
};

export default RubiksCube;
